import '../css/Navbar.css';

function Navbar() {

    function handleClick() {
        alert('logged in');
    }

    return (
        <header className='Navbar'>
            <h1>Jitesh Kumar Verma</h1>
            <div>
                <button onClick={ () => alert('logg') }>Login</button>
                <button>Sign up</button>
            </div>
        </header>
    );
}

export default Navbar;
